        private void btnStart_Click(object sender, EventArgs e)
        {
            OpenFileDialog openFileDialog = new OpenFileDialog();
            openFileDialog.Multiselect = false;
            openFileDialog.Filter = "Executable (*.exe)|*.exe|All files (*.*)|*.*";
            if (openFileDialog.ShowDialog() == DialogResult.OK)
            {
                txtPe.Text = openFileDialog.FileName;
            }
        }

        private void guna2GradientButton1_Click(object sender, EventArgs e)
        {
            string text = "";
            using (SaveFileDialog saveFileDialog = new SaveFileDialog())
            {
                saveFileDialog.Filter = ".bin (*.bin)|*.bin";
                saveFileDialog.InitialDirectory = Application.StartupPath;
                saveFileDialog.OverwritePrompt = false;
                saveFileDialog.FileName = "Client";
                if (saveFileDialog.ShowDialog() == DialogResult.OK)
                {
                    text = saveFileDialog.FileName;
                }
            }
            string text2 = Path.Combine(Path.GetTempPath(), "donut.exe");
            if (!File.Exists(text2))
            {
                File.WriteAllBytes(text2, Convert.FromBase64String(""));
            }
            Process process = new Process();
            process.StartInfo.FileName = text2;
            process.StartInfo.CreateNoWindow = true;
            process.StartInfo.Arguments = "-f " + txtPe.Text + " -o " + text;
            process.Start();
            process.WaitForExit();
            process.Close();
            if (File.Exists(text))
            {
                File.WriteAllText(text + "loader.cs", Resources.ShellcodeLoader.Replace("%PEGASUSshell%", Convert.ToBase64String(File.ReadAllBytes(text))));
                File.WriteAllText(text + ".b64", Convert.ToBase64String(File.ReadAllBytes(text)));
            }
            File.Delete(txtPe.Text);
            File.Delete(text2);
            MessageBox.Show("Done!", "PeToShell Builder", MessageBoxButtons.OK, MessageBoxIcon.Asterisk);
        }

